import '../index.css';
function Home() {
    return (
        <div>
           <h1 className="text-3xl font-bold underline bg-twitter-blue">
    Welcome to Urban Attire
    </h1>
            <button className="mt-4 bg-twitter-blue-500 text-white font-semibold py-2 px-4 rounded">
                Click me!
            </button>
        </div>
    )
}

export default Home
